$(document).ready(function(){getAchives()});$(".menu a").click(function(){$(".content section").each(function(){$(this).removeClass("active")});$($(this).attr("choose")).addClass("active")});function getAchives(){var a="";$.ajax({type:"GET",url:"https://yuncaioo.com/wp-json/wp/v2/posts?per_page=10&page=1",dataType:"json",success:function(c){for(var b=0;b<c.length;b++){a+='<li><a href="'+c[b].link+'" target="_blank">'+c[b].title.rendered+'<span class="date"> / '+c[b].date+"</span></a></li>";$(".archive-list").html(a)}}})};